  }, {
      'parameter_id': 'dnn_beta_2',
      'discrete_value_spec': {
          'values': [0.8, 0.9, 0.999]
      }
  }, {
      'parameter_id': 'batch_size',
      'discrete_value_spec': {
          'values': [1024, 2048, 4096, 8192, 16384]
      }
  }]

  override_params = {}
  for param in study_spec_parameters_override:
    override_params[param['parameter_id']] = param

  study_spec_parameters = []
  for param in default_params:
    study_spec_parameters.append(
        override_params.get(param['parameter_id'], param))

  return study_spec_parameters

def _serialize_json(obj) -> str:
    if isinstance(obj, str):
        return obj
    import json

    def default_serializer(obj):
        if hasattr(obj, 'to_struct'):
            return obj.to_struct()
        else:
            raise TypeError(
                "Object of type '%s' is not JSON serializable and does not have .to_struct() method."
                % obj.__class__.__name__)

    return json.dumps(obj, default=default_serializer, sort_keys=True)

